import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => (
  <nav className='bg-white shadow p-4 flex justify-between items-center'>
    <Link to='/' className='text-xl font-bold text-orange-600'>Coding Ninjas</Link>
    <div className='space-x-4'>
      <Link to='/' className='hover:text-orange-500'>Home</Link>
      <Link to='/courses' className='hover:text-orange-500'>Courses</Link>
      <Link to='/about' className='hover:text-orange-500'>About</Link>
      <Link to='/login' className='hover:text-orange-500'>Login</Link>
      <Link to='/register' className='hover:text-orange-500'>Register</Link>
    </div>
  </nav>
);

export default Navbar;
